import React from 'react';
import { Link } from 'react-router-dom';
import {
    SideNav,
    SideNavItems,
    SideNavLink
  } from 'carbon-components-react';

export default class Sidebar extends React.Component {
    constructor(props) {
        super(props)
    }

    linkClicked(data) {
        console.log("LINK CLICKED: " + data)
        for(var i = 0; i < data.keys().length; i++) {
            console.log(data.keys()[i] + ' -> ' + data[data.keys()[i]]);
        }
    }

    render () {
        return <SideNav
                isFixedNav
                expanded={true}
                isChildOfHeader={false}
                aria-label="Side navigation">
                <SideNavItems>
                    <SideNavLink element={Link} to="/" onClick={ this.linkClicked } isActive={true}>
                        Overview
                    </SideNavLink>
                    <SideNavLink element={Link} to="/engagement" onClick={ this.linkClicked }>
                        Engagement
                    </SideNavLink>
                </SideNavItems>
            </SideNav>
    }
}
